webpackJsonp([0xf162a7d84c45b000],{"./node_modules/json-loader/index.js!./.cache/json/git-git-branch.json":function(e,t){e.exports={data:{markdownRemark:{html:'<h2>Git Branch</h2>\n<p>Git’s branching functionality lets you create new branches of a project to test ideas, isolate new features, or experiment without impacting the main project.</p>\n<p><strong>Table of Contents</strong></p>\n<ul>\n<li><a href="#view-branches">View Branches</a></li>\n<li><a href="#checkout-a-branch">Checkout a Branch</a></li>\n<li><a href="#create-a-new-branch">Create a New Branch</a></li>\n<li><a href="#rename-a-branch">Rename a Branch</a></li>\n<li><a href="#delete-a-branch">Delete a Branch</a></li>\n<li><a href="#compare-branches">Compare Branches</a></li>\n<li><a href="#help-with-git-branch">Help with Git Branch</a></li>\n<li><a href="#more-information">More Information</a></li>\n</ul>\n<h3>View Branches <a name="view-branches"></a></h3>\n<p>To view the branches in a Git repository, run the command:</p>\n<div class="gatsby-highlight">\n      <pre class="language-shell"><code>git branch</code></pre>\n      </div>\n<p>There will be an asterisk (*) next to the branch that you’re currently on.</p>\n<p>There are a number of different options you can include with <code>git branch</code> to see different information. For more details about the branches, you can use the <code>-v</code> (or <code>-vv</code>, or <code>--verbose</code>) option. The list of branches will include the SHA-1 value and commit subject line for the <code>HEAD</code> of each branch next to its name.</p>\n<p>You can use the <code>-a</code> (or <code>--all</code>) option to show the local branches as well as any remote branches for a repository. If you only want to see the remote branches, use the <code>-r</code> (or <code>--remotes</code>) option.</p>\n<h3>Checkout a Branch <a name="checkout-a-branch"></a></h3>\n<p>To checkout an existing branch, run the command:</p>\n<div class="gatsby-highlight">\n      <pre class="language-shell"><code>git checkout BRANCH-NAME</code></pre>\n      </div>\n<p>Generally, Git won’t let you checkout another branch unless your working directory is clean, because you would lose any working directory changes that aren’t committed. You have three options to handle your changes: 1) trash them (see <a href=\'https://guide.freecodecamp.org/git/git-checkout/\' target=\'_blank\' rel=\'nofollow\'>Git checkout for details</a>), 2) commit them (see <a href=\'https://guide.freecodecamp.org/git/git-commit/\' target=\'_blank\' rel=\'nofollow\'>Git commit for details</a>), or 3) stash them (see <a href=\'https://guide.freecodecamp.org/git/git-stash/\' target=\'_blank\' rel=\'nofollow\'>Git stash for details</a>).</p>\n<h3>Create a New Branch <a name="create-a-new-branch"></a></h3>\n<p>To create a new branch, run the command:</p>\n<div class="gatsby-highlight">\n      <pre class="language-shell"><code>git branch NEW-BRANCH-NAME</code></pre>\n      </div>\n<p>Note that this command only creates the new branch. You’ll need to run <code>git checkout NEW-BRANCH-NAME</code> to switch to it.</p>\n<p>There’s a shortcut to create and checkout a new branch at once. You can pass the <code>-b</code> option (for branch) with <code>git checkout</code>. The following commands do the same thing:</p>\n<div class="gatsby-highlight">\n      <pre class="language-shell"><code># Two-step method\ngit branch NEW-BRANCH-NAME\ngit checkout NEW-BRANCH-NAME\n\n# Shortcut\ngit checkout -b NEW-BRANCH-NAME</code></pre>\n      </div>\n<p>When you create a new branch, it will include all commits from the parent branch. The parent branch is the branch you’re on when you create the new branch.</p>\n<h3>Rename a Branch <a name="rename-a-branch"></a></h3>\n<p>To rename a branch, run the command:</p>\n<div class="gatsby-highlight">\n      <pre class="language-shell"><code>git branch -m OLD-BRANCH-NAME NEW-BRANCH-NAME\n\n# Alternative\ngit branch --move OLD-BRANCH-NAME NEW-BRANCH-NAME</code></pre>\n      </div>\n<h3>Delete a Branch <a name="delete-a-branch"></a></h3>\n<p>Git won’t let you delete a branch that you’re currently on. You first need to checkout a different branch, then run the command:</p>\n<div class="gatsby-highlight">\n      <pre class="language-shell"><code>git branch -d BRANCH-TO-DELETE\n\n# Alternative:\ngit branch --delete BRANCH-TO-DELETE</code></pre>\n      </div>\n<p>The branch that you switch to makes a difference. Git will throw an error if the changes in the branch you’re trying to delete are not fully merged into the current branch. You can override this and force Git to delete the branch with the <code>-D</code> option (note the capital letter) or using the <code>--force</code> option with <code>-d</code> or <code>--delete</code>:</p>\n<div class="gatsby-highlight">\n      <pre class="language-shell"><code>git branch -D BRANCH-TO-DELETE\n\n# Alternatives\ngit branch -d --force BRANCH-TO-DELETE\ngit branch --delete --force BRANCH-TO-DELETE</code></pre>\n      </div>\n<h3>Compare Branches <a name="compare-branches"></a></h3>\n<p>You can compare branches with the <code>git diff</code> command:</p>\n<div class="gatsby-highlight">\n      <pre class="language-shell"><code>git diff FIRST-BRANCH..SECOND-BRANCH</code></pre>\n      </div>\n<p>You’ll see colored output for the changes between branches. For all lines that have changed, the <code>SECOND-BRANCH</code> version will be a green line starting with a ”+”, and the <code>FIRST-BRANCH</code> version will be a red line starting with a ”-“. If you don’t want Git to display two lines for each change, you can use the <code>--color-words</code> option. Instead, Git will show one line with deleted text in red, and added text in green.</p>\n<p>If you want to see a list of all the branches that are completely merged into your current branch (in other words, your current branch includes all the changes of the other branches that are listed), run the command <code>git branch --merged</code>.</p>\n<h3>Help with Git Branch <a name="help-with-git-branch"></a></h3>\n<p>If you forget how to use an option, or want to explore other functionality around the <code>git branch</code> command, you can run any of these commands:</p>\n<div class="gatsby-highlight">\n      <pre class="language-shell"><code>git help branch\ngit branch --help\nman git-branch</code></pre>\n      </div>\n<h3>More Information:  <a name="more-information"></a></h3>\n<ul>\n<li>The <code>git merge</code> command: <a href=\'https://guide.freecodecamp.org/git/git-merge/\' target=\'_blank\' rel=\'nofollow\'>fCC Guide</a></li>\n<li>The <code>git checkout</code> command: <a href=\'https://guide.freecodecamp.org/git/git-checkout/\' target=\'_blank\' rel=\'nofollow\'>fCC Guide</a></li>\n<li>The <code>git commit</code> command: <a href=\'https://guide.freecodecamp.org/git/git-commit/\' target=\'_blank\' rel=\'nofollow\'>fCC Guide</a></li>\n<li>The <code>git stash</code> command: <a href=\'https://guide.freecodecamp.org/git/git-stash/\' target=\'_blank\' rel=\'nofollow\'>fCC Guide</a></li>\n<li>Git documentation: <a href=\'https://git-scm.com/docs/git-branch\' target=\'_blank\' rel=\'nofollow\'>branch</a></li>\n</ul>',fields:{slug:"/git/git-branch/"},frontmatter:{title:"Git Branch"}}},pathContext:{slug:"/git/git-branch/"}}}});
